package contracts

import (
	"github.com/ethereum/go-ethereum/common"
	"github.com/ethereum/go-ethereum/common/hexutil"
)

var (
	// arthera-contracts/deployedBytecode, solc 0.8.17, optimize-runs 10000
	NodeDriverBytecode           = hexutil.MustDecode("")
	NodeDriverAuthBytecode       = hexutil.MustDecode("")
	PayAsYouGoGasRewardsBytecode = hexutil.MustDecode("")
	StakingBytecode              = hexutil.MustDecode("")
	ValidatorInfoBytecode        = hexutil.MustDecode("")
	SubscribersBytecode          = hexutil.MustDecode("")
	NetworkInitializerBytecode   = hexutil.MustDecode("")
)

var (
	NetworkInitializerSmartContractAddress = common.BytesToAddress([]byte{0xAA, 0x00})
	EvmWriterSmartContractAddress          = common.BytesToAddress([]byte{0xAA, 0x01})
	NodeDriverSmartContractAddress         = common.BytesToAddress([]byte{0xAA, 0x02})
	NodeDriverAuthSmartContractAddress     = common.BytesToAddress([]byte{0xAA, 0x03})
	StakingSmartContractAddress            = common.BytesToAddress([]byte{0xAA, 0x04})
	ValidatorInfoSmartContractAddress      = common.BytesToAddress([]byte{0xAA, 0x05})
	PayAsYouGoGasRewardsContractAddress    = common.BytesToAddress([]byte{0xAA, 0x06})
	SubscribersSmartContractAddress        = common.BytesToAddress([]byte{0xAA, 0x07})
	EmitterDriverSmartContractAddress      = common.BytesToAddress([]byte{0xAA, 0x08})
)

func IsSystemContract(address common.Address) bool {
	return address == NetworkInitializerSmartContractAddress ||
		address == NodeDriverSmartContractAddress ||
		address == NodeDriverAuthSmartContractAddress ||
		address == EvmWriterSmartContractAddress ||
		address == PayAsYouGoGasRewardsContractAddress ||
		address == StakingSmartContractAddress ||
		address == SubscribersSmartContractAddress ||
		address == ValidatorInfoSmartContractAddress

}
